Step-by-step reasoning:
1. Key Psychological Mechanisms: In the Ultimatum Game, responders care not only about their own payoff but also about the fairness of the split. Under the Fehr–Schmidt framework, when a responder receives more than the proposer (i.e. advantageous inequality), they may experience an aversion to being “better off” than the other. This is captured by a penalty term.
2. Interaction of Mechanisms: The responder’s utility is modeled as the monetary gain (split_self) minus a penalty proportional to the extent of the advantageous inequality (split_self minus split_opp). Since the dataset always has split_self > split_opp, we include only the parameter penalizing advantageous inequality.
3. Mathematical Form: The utility (U) of accepting an offer is given by U = split_self – beta_param*(split_self – split_opp), where beta_param governs the degree of disadvantage aversion for advantageous inequality.
4. Learnable Parameters: Only one learnable parameter is needed here (beta_param), representing the disutility per unit of advantageous inequality. Its bounds can be set generously (e.g. 0 to 5).
5. Mapping to Observed Variables: The model uses the observable monetary splits (split_self and split_opp) to compute the utility for a responder’s acceptance decision.

Below is the formal model specification.

<MODEL>
U = split_self - beta_param*(split_self - split_opp)
</MODEL>

